// Solution 1:
const rearrangeArray = (arr) => {
    let leftArr = [];
    let rightArr = [];
    for(let i=0; i<arr.length; i++){
        if(arr[i] === 'a'){
            leftArr.push('a');
        } else {
            rightArr.unshift(arr[i]);
        }
    }
    return [...leftArr,...rightArr];
}

console.log(rearrangeArray(['h','h','h','a','a','g','a'])) //['a', 'a', 'h', 'h', 'h', 'g', 'a']
